              >
                Home
              </button>
</Link>

              {" "}


            <Link
              to="/explore">

              
              <button
              
              style={{outline: 'none'}}
                class="btn btn-info btn-block"
                type="button"
                
              >
                Explore
              </button>


              </Link>

              {" "}

              <Link
              to="/salepagecopy">

              
              <button
                class="btn btn-info btn-block"
                type="button"
                // onClick={() => {
                //   history.push("/Salepagecopy");
                // }}
              >
                Myitem     
              </button>
              </Link>

              {" "}

              <Link
              to="/followingpage">

              <button
                class="btn btn-info btn-block"
                type="button"
                // onClick={() => {
                //   history.push("/Followingpage");
                // }}
              >
               Following
              </button>
              </Link>

              {" "}
              <Link
              to="/activitypage">
              <button
                class="btn btn-info btn-block"
                type="button"
                // onClick={() => {
                //   history.push("/Activitypage");
                // }}
              >
               Activity
              </button>
              </Link>

              {" "}

              <Link
              to="/howitworkpage">

              <button
                class="btn btn-info btn-block"
                type="button"
                
              >
               How it works
              </button>

</Link>
              {" "}
              <Link
              to="/communitypage">
              <button
                class="btn btn-info btn-block"
                type="button"
                
              >
               Community
              </button>
              </Link>

              {" "}
              <Link
              to="/nft">
              <button
                class="btn btn-info btn-block"
                type="button"
                // 
              >
               Create
              </button>
              </Link>

              {" "}



      

              <button
              id="bu"
                class="btn btn-info btn-block"
                type="button"
                onClick= {connectmm}>
               Connect wallet
              </button>

              {" "}



              <br></br>






        {/* <div>


        <h1>hellooooooooo</h1>

        <h2>a{getIm.setPrice}</h2>

        <h2>b{getIm.cAddress}</h2>

        <h2>c{key}</h2>

        </div> */}

<div>

{getIm.length === 0 ? null :( 
  <div style={{backgroundColor:'skyblue',display:'flex',flexWrap:'wrap'}}>
    
    
      

        <div style={{backgroundColor:'skyblue',height:'600px',width:'300px'}}>
  
    
        <img   src={getIm.imageUrl}  style={{height:250,width:250}} alt=""    />
  
    
        <h3>Name : {getIm.userName}</h3>
      
        <h3>Symbol : {getIm.userSymbol}</h3>

        <h3>Token_id : {getIm.id}</h3>
      
        <h3>price : {getIm.priceSet}</h3>

        <h3>Contract_Address : {getIm.cAddress}</h3>
      
        <h3>Status : {getIm.extra1}</h3>
      
        <h3>Owner_Address : {getIm.ownerAddress}</h3>

      
      
      {/* { <button onClick={()=>buynow(a)} >BuyNow</button> } */}
    
      {' '}
      </div>
      
  
  </div>
)}

  </div>    
  
  

</div>

    );

}

export default DisplayData;
